sys_variable_value.value:
// The number of times the workflow has attempted to invoke the action.
workflow.scratchpad.invoke_attempts = 0;
// The number of times to retry failed requests.
workflow.scratchpad.retries_permitted = Math.max(Util.getSystemPropertyInt(C.sysprop.retryLimit, 10), 10);
// The base delay between each retry.
workflow.scratchpad.retry_delay_seconds = Math.max(Util.getSystemPropertyInt(C.sysprop.retryDelaySeconds, 1), 1);
// Object to hold any state generated by repeated applications of the function.
workflow.scratchpad.wf_state = '{}';

// The number of times the workflow has attempted to invoke the action.
workflow.scratchpad.invoke_attempts = 0;
// The number of times to retry failed requests.
workflow.scratchpad.retries_permitted = Math.max(Util.getSystemPropertyInt(C.sysprop.retryLimit, 10), 10);
// The base delay between each retry.
workflow.scratchpad.retry_delay_seconds = Math.max(Util.getSystemPropertyInt(C.sysprop.retryDelaySeconds, 1), 1);
// Object to hold any state generated by repeated applications of the function.
workflow.scratchpad.wf_state = '{}';

/**
 * Executes a function in WorkflowTasks and uses its result to transition.
 *
 * Expects the workflow to have been configured with inputs `u_context`, a JSON string indicating
 * the context for the task, and `u_function`, indicating the function in WorkflowTasks to execute.
 */
(function () {

    var TRANSITIONS = {
        SUCCESS: 'success',
        ERROR: 'error',
        RETRY: 'retry',
    };

    function succeed() {
        activity.result = TRANSITIONS.SUCCESS;
        workflow.setResult(TRANSITIONS.SUCCESS);
    }

    function retry(message) {
        activity.result = TRANSITIONS.RETRY;
        activity.fault_description = message;
    }

    function fail(message) {
        activity.result = TRANSITIONS.ERROR;
        activity.fault_description = message;
        workflow.warn(message);
        workflow.setResult(TRANSITIONS.ERROR);
    }
    
    var context = null;
    try {
        context = JSON.parse(workflow.inputs.u_context);
    } catch (err) {
        return fail("Error parsing context as JSON: " + err.message);
    }

    var state = null;
    try {
        state = JSON.parse(workflow.scratchpad.wf_state);
    } catch (err) {
        return fail("Error parsing function state as JSON: " + err.message);
    }

    var fn = Util.getObjectWithName(workflow.inputs.u_function, WorkflowTasks);
    if (typeof fn['run'] !== "function") {
        return fail("No such function run on WorkflowTasks: " + workflow.inputs.u_function);
    }
    if (workflow.scratchpad.invoke_attempts < 1) {
        workflow.info('Invoke function ' + workflow.inputs.u_function);
    }

    workflow.scratchpad.invoke_attempts += 1;
    var maxRetries = workflow.scratchpad.retries_permitted,
        attempts = workflow.scratchpad.invoke_attempts;
    workflow.debug('Invocation attempt ' + attempts + "/" + maxRetries);

    var r = null;
    try {
        r = fn['run'](context, state);
    } catch (e) {
        return fail("Caught error: " + (e.message || e.toString()));
    }

    if (r && !r.success) {
        if (r.canRetry && attempts < maxRetries) {
            // Serialise the state for the next execution.
            workflow.scratchpad.wf_state = JSON.stringify(r.state);
            return retry(r.message);
        } else {
            return fail("Function failing after " + attempts +
                " attempt" + (attempts !== 1 ? "s" : "") + ". Last failure was: " + r.message)
        }
    }
    workflow.info('Function ' + workflow.inputs.u_function + ' finished successfully');
    return succeed();

})();

