/**
 * Calculate the interval to wait before retrying the invoke-task workflow
 * Two configurations:
 * 1- No u_wait_interval_exponential_backoff provided: wait with constant interval
 * 2- u_wait_interval_exponential_backoff provided: wait with an exponential backoff interval
 */
(function () {
    if (workflow.inputs.u_exponential_backoff_wait) {
        exponentialBackoffInterval();
    } else {
        regularInterval();
    }

    // Set 'answer' to the number of seconds this timer should wait
    function regularInterval() {
        answer = workflow.scratchpad.retry_delay_seconds * workflow.scratchpad.invoke_attempts;
        workflow.debug('Regular interval mode: waiting: ' + answer + ' seconds before retrying');
    }

    /** Set 'answer' to the number of seconds this timer should wait combined with an exponential backoff of rate 2.3
     * This value was chosen in order to timeout after about 20 minutes:
     * If retry_delay_seconds is 1 second, and invoke_attempts is maximum 20: the maximum interval will be 23 minutes, 5 seconds
     */
    function exponentialBackoffInterval() {
        answer = workflow.scratchpad.retry_delay_seconds * Math.pow(2.3, workflow.scratchpad.invoke_attempts);
        workflow.debug('Exponential backoff interval mode: waiting: ' + answer + ' seconds before retrying');
    }

})();

